    geo_json_e9610fd33c1104c8cb4e8d2ab6a558bf.bindPopup(
    function(layer){
    let div = L.DomUtil.create('div');
    
    let handleObject = feature => {
        if (feature === null) {
            return '';
        } else if (typeof(feature)=='object') {
            return JSON.stringify(feature);
        } else {
            return feature;
        }
    }
    let fields = ["id", "premium", "lam", "p_trig", "n_ev", "e_loss"];
    let aliases = ["Pixel", "Premium ($)", "\u03bb (annual)", "P(trigger)", "N events", "E[loss] ($)"];
    let table = '<table>' +
        String(
        fields.map(
        (v,i)=>
        `<tr>
            <th>${aliases[i].toLocaleString()}</th>
            
            <td>${handleObject(layer.feature.properties[v]).toLocaleString()}</td>
        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }

  "className": "foliumpopup",
